import "./App.css";
import { Route, Routes } from "react-router-dom";
import { useState } from "react";
import TagPage from "./TagPage";
import Home from "./Home.js";
import AddPage from "./AddPage.js";

//practice using context by making page and set page in a context

function App() {
  const [page, setPage] = useState("/");
  return (
    <>
      <Routes>
        <Route path="/" element={<Home setPage={setPage} />} />
        <Route
          path="/add"
          element={<AddPage page={page} setPage={setPage} />}
        />
        <Route
          path="/tag"
          element={<TagPage page={page} setPage={setPage} />}
        />
      </Routes>
    </>
  );
}

export default App;
